import React, { Component } from "react";
import Chart from "react-apexcharts";

class Graph extends Component {
  state = {};
  render() {
    return (
      <Chart
        options={this.props.options}
        series={this.props.series}
        type="line"
        width="500"
      />
    );
  }
}

export default Graph;
